import { useEffect } from 'react';

function ProductImages({ imgUrl, name }) {

  useEffect(() => {
    const imageName = name.toLowerCase().replace(/\s/g, '-') + '.jpg';
    const imagePath = import(`../images/products/${imageName}`);
  })

  return(
    <div>
      <img src={require(imagePath).default} alt={name} />
      <img src={imgUrl} alt={name} />
      <img src={imgUrl} alt={name} />
      <img src={imgUrl} alt={name} />
      <img src={imgUrl} alt={name} />
    </div>
  )
}

export default ProductImages;
